import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    titulo1:{
        backgroundColor:'white',
        borderBottomWidth:4,
        borderColor: '#0174DF',
        paddingTop:10,
        fontWeight: 'bold',
        color:'#0174DF',
        fontSize:20
    },
    titulo2:{
        color:'#0174DF',
        fontSize:20
    },
    shortInput:{
        color:'#808080',
        borderRadius:8, 
        textAlignVertical: 'top',
        width:150,
        fontSize:20,
        height:30, 
        borderColor: 'gray',
        borderWidth: 1
    },
    totalFilde:{
        color:'#808080',
        fontSize:25
    },
    LongInput:{
        color:'#808080',
        borderRadius:8,
        fontSize:20, 
        textAlignVertical: 'top',
        width:600,
        height:80, 
        borderColor: 'gray', 
        borderWidth: 1 
    },
    sgoTitle:{
        fontSize: 40,
        justifyContent:'center',
        alignItems: 'center',
        fontWeight: 'bold',
        color:'#0174DF'
    },
    title: {
        fontSize:40,
        backgroundColor: 'white',
        alignItems: 'center',
        justifyContent: 'center',
        color:'#00008B'
    },
    titleText: {
        fontSize:80,
        justifyContent:'center',
        alignItems: 'center',
        fontWeight: 'bold',
        color:'#0174DF'
    },
    container: {
        paddingTop: 20,
        alignItems: 'center'
    },
    container2: {
        marginLeft:8,
        marginRight:8
    },
    buttonView: {
        borderRadius:5,
        marginBottom: 30,
        width: 260,
        alignItems: 'center',
        backgroundColor: '#2196F3'
    },
    buttonG: {
        textAlign: 'center',
        padding: 20,
        color: 'white'
    },
    buttonP: {
        borderRadius: 10,
        color: '#0174DF'
    },
    mainView: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center'
    },
    textInput: {
        height: 50,
        borderRadius: 3,
        width: 280,
        borderColor: 'gray',
        borderWidth: 1,
        fontSize:20,
        padding: 8        
    },     
    label: {
        fontSize:25,
        color:'#0174DF'
    },
    messageText: {
        color: 'red'
    },
    checkBox: {
        flex: 1,
        padding: 10
    },
    datePicker: {
        position: 'absolute',
        left: 0,
        top: 4,
        marginLeft: 0,
        marginLeft: 36
    },
    loadingContainer:{
        marginTop:250,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    
    },
    loadingText:{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        fontSize:30,
        color:'#0174DF'
    },
    headerText:{
        color: 'white',
        width: 80,
        fontSize: 10
    }
});
